\c postgres
drop database if exists assignment1 with (force);
create database assignment1;
\c assignment1

-- Now connected to an empty A1 DB and ready to begin the script. 

\set ECHO none
\set QUIET on

BEGIN TRANSACTION;

CREATE TABLE CUSTOMER (
    CUSTOMERNO  INTEGER,
    CNAME       VARCHAR(20),
    PHONE       VARCHAR(10)
);

CREATE TABLE DEPT (
    DEPTNO      SMALLINT,
    DNAME       VARCHAR(20),
    DLOCATION   VARCHAR(50)
);

CREATE TABLE STAFF (
    STAFFNO     INTEGER,
    STAFFNAME   VARCHAR(20),
    POSITION    VARCHAR(20),
    DEPTNO      SMALLINT
);

CREATE TABLE SALES (
    SALENO         INTEGER,
    RECEIPTNO      INTEGER,
    SERVICETYPE    VARCHAR(25),
    PAYMENTTYPE    VARCHAR(10),
    GST            VARCHAR(3),
    AMOUNT         NUMERIC(8,2), 
    SERVEDBY       INTEGER,
    CUSTOMERNO     INTEGER,
    SALETIME       TIMESTAMP
);


ALTER TABLE STAFF ADD CONSTRAINT PK_STAFFNO PRIMARY KEY (STAFFNO);
ALTER TABLE DEPT ADD CONSTRAINT PK_DEPTNO PRIMARY KEY (DEPTNO);
ALTER TABLE CUSTOMER ADD CONSTRAINT PK_CUSTOMERNO PRIMARY KEY (CUSTOMERNO);

-- Testing hint: you should ultimately be able to run your script at this point:
-- \i 4xxxxxxx_A1.sql
-- and have no errors as a result of the inserts below.






COMMIT;

ANALYZE CUSTOMER, DEPT, STAFF, SALES;

\echo 'Finished running setup script.' 
\echo 'All tables have been created and data inserted.'
\echo 'You are now ready to proceed.'